import React from "react";
import {useFormik} from 'formik';
function Newap(){
    const formik = useFormik({
        initialValues:{
            username: "",
            name: "",
            email: ""
        }
    })
    console.log(formik.values)
    return(
        <div className="newappl">
            <form>
                <input
                   type="text"
                   name="username"
                   className="cmn-inpt"
                   onchange={formik.handleChange}
                   value={formik.values.username}
                />
                <input
                   type="text"
                   name="name"
                   className="cmn-inpt"
                   onchange={formik.handleChange}
                   value={formik.values.username}
                />
                <input
                   type="email"
                   name="email"
                   className="cmn-inpt"
                   onchange={formik.handleChange}
                   value={formik.values.username}
                />
            </form>
        </div>
    )
}
export default Newap;
